import { Routes, Route, Navigate } from 'react-router-dom';
import Play from './pages/play/play';




function App() {
  return (
    <Routes>
      <Route path="/" exact element={<Play />} />
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
}

export default App;
